description:
This Grey American Apparel &#8220;Track t-shirt&#8221; features an artistic design on the front.
Enjoy everything you love about the fit, feel, and durability of a vintage t-shirt, in a brand new version.
The print on the shirt says

	&#8220;Forget your compass and stars&#8221; 
&#8220;This world will tear you apart&#8221;

	These are lyrics from a song by Forgive Durden off their Fueled by Ramen Album &#8220;Wonderland&#8221;

	Tri-Blend (50% Polyester / 25% Cotton / 25% Rayon) construction
